TABLEATTRIBUTE.VALUE:
SELECT MAX(CPAY_DATE)- MAX(POST_DATE) STOP_FLAG FROM (SELECT CASE WHEN UPPER(E.DESCRIPTION) LIKE '%STAGE=COMPENSATEANDPAY%' THEN E.STARTTIME ELSE DATE '1000-01-01' END CPAY_DATE, CASE WHEN UPPER(E.DESCRIPTION) LIKE '%STAGE=$$STR_PIPELINE_STATUS%' THEN E.STARTTIME ELSE DATE '1000-01-01' END POST_DATE FROM CS_PERIOD@TC_LINK A, CS_CALENDAR@TC_LINK B, CS_PERIODTYPE@TC_LINK C, IN_ETL_CONTROL D, CS_PIPELINERUN@TC_LINK E, cs_processingunit@TC_LINK F WHERE A.CALENDARSEQ = B.CALENDARSEQ AND A.PERIODTYPESEQ = C.PERIODTYPESEQ AND E.PERIODSEQ = A.PERIODSEQ AND e.processingunitseq = f.processingunitseq AND A.REMOVEDATE = TO_DATE('1/1/2200','MM/DD/YYYY') AND B.REMOVEDATE = TO_DATE('1/1/2200','MM/DD/YYYY') AND C.REMOVEDATE = TO_DATE('1/1/2200','MM/DD/YYYY') AND E.REMOVEDATE = TO_DATE('1/1/2200','MM/DD/YYYY') AND LOWER(B.NAME) = '$$STR_CALENDAR_NAME' AND LOWER(C.NAME) = 'month' AND D.TXT_KEY_STRING = 'OPER_CYCLE_DATE' AND D.TXT_FILE_NAME ='GLOBAL' AND A.STARTDATE <= TO_DATE(D.TXT_KEY_VALUE,'YYYY-MM-DD') AND A.ENDDATE > TO_DATE(D.TXT_KEY_VALUE,'YYYY-MM-DD') AND E.STATUS = 'Successful' AND f.name='$$STR_PROCESSING_UNIT' --AND UPPER(E.DESCRIPTION) LIKE '%STAGE=$$STR_PIPELINE_STATUS%'
union all select DATE'1000-01-01', DATE'1000-01-01' from dual
)

