UPDATE OUT_ACCT_DETAIL ACCT SET (TXT_STATUS, DTE_UPDATE) = (SELECT 'DELETE', SYSDATE FROM DUAL) WHERE TXT_STATUS = 'ACTIVE' AND EXISTS (SELECT 1 FROM IN_ETL_CONTROL L WHERE L.TXT_KEY_STRING = '$$STR_MAX_CYCLE_DATE' AND L.TXT_FILE_NAME = '$$STR_PROCESSING_UNIT' AND NVL(L.DEC_ENFORCE_FLG, 0) != 2) AND EXISTS (SELECT 1 FROM IN_ETL_CONTROL ICTRLDATE, IN_ETL_CONTROL ICTRLTYPE WHERE ICTRLDATE.TXT_KEY_STRING = 'OPER_CYCLE_DATE' AND ICTRLDATE.TXT_FILE_NAME = 'GLOBAL' AND ICTRLTYPE.TXT_KEY_STRING = '$$STR_ACCT_CYCLE_TYPE' AND ICTRLTYPE.TXT_FILE_NAME = '$$STR_PROCESSING_UNIT' AND ACCT.DTE_CYCLE_DATE = TO_DATE(ICTRLDATE.TXT_KEY_VALUE, 'YYYY-MM-DD') AND ACCT.TXT_CYCLE_TYPE = ICTRLTYPE.TXT_KEY_VALUE AND ACCT.TXT_PROCESSINGUNIT = ICTRLTYPE.TXT_FILE_NAME);
COMMIT;
insert into OUT_GL_DELTASNAPSHOT_EXCEPTION select gl.* from (select * from out_gl_deltasnapshot where batchnum in (select out_gl_batch.batchnum from out_gl_batch, in_etl_control where in_etl_control.txt_key_string = 'OPER_CYCLE_DATE' and in_etl_control.TXT_FILE_NAME = 'GLOBAL' and out_gl_batch.status = 'COMPLETED' and out_gl_batch.processingunitname = '$$STR_PROCESSING_UNIT' and out_gl_batch.cycledate = to_date(in_etl_control.txt_key_value, 'yyyy-mm-dd'))) gl left join (select distinct txt_position_name from out_payment_detail, in_etl_control where in_etl_control.txt_key_string = 'OPER_CYCLE_DATE' and in_etl_control.TXT_FILE_NAME = 'GLOBAL' and out_payment_detail.dte_cycle_date = to_date(in_etl_control.txt_key_value, 'yyyy-mm-dd') and out_payment_detail.TXT_PROCESSING_UNIT = '$$STR_PROCESSING_UNIT' and out_payment_detail.TXT_STATUS = 'ACTIVE') pay on gl.agentcode = pay.txt_position_name where pay.txt_position_name is null and gl.agentcode is not null and gl.earninggroupid = 'SGD_DAH';
commit;
delete from out_gl_deltasnapshot gl where exists (select 1 from OUT_GL_DELTASNAPSHOT_EXCEPTION gl_bak where gl.batchnum = gl_bak.batchnum and gl.agentcode = gl_bak.agentcode and gl.earninggroupid = gl_bak.earninggroupid and gl.accountcode = gl_bak.accountcode) and gl.batchnum in (select out_gl_batch.batchnum from out_gl_batch, in_etl_control where in_etl_control.txt_key_string = 'OPER_CYCLE_DATE' and in_etl_control.TXT_FILE_NAME = 'GLOBAL' and out_gl_batch.status = 'COMPLETED' and out_gl_batch.processingunitname = '$$STR_PROCESSING_UNIT' and out_gl_batch.cycledate = to_date(in_etl_control.txt_key_value, 'yyyy-mm-dd'));
commit;
